import { makeStyles, Typography } from "@material-ui/core";
import React from "react";

const useStyles = makeStyles({
  root: {
    width: "100vw",
    height: 600,
    padding: "5%",
    color: "white",
    background:
      "transparent linear-gradient(180deg, #000266 0%, #032C73 57%, #00163B 100%, #003A67 100%) 0% 0% no-repeat padding-box",
  },
});

const useContentStyles = makeStyles({
  root: {
    display: "flex",
    flexDirection: "column",
  },
});

const Hero: React.FC<{}> = () => {
  const classes = useStyles();
  const contentStyles = useContentStyles();

  return (
    <div className={classes.root}>
      <div className={contentStyles.root}>
        <Typography component="h1" variant="h4">Why <span></span>Smartifier</Typography>
      </div>
    </div>
  );
};

export default Hero;
